<p>RabbitMQ是最常见的消息队列中间件之一，相比Kafka在中小型项目中应用更广。该文针对RabbitMQ在Java环境的使用进行展开。主要是通过RabbitMQ来深入理解消息队列(下简称MQ)这一种中间件。</p>
